import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from './components/pages';

function App() {
  return (
    <>
    <Router>
    <Navbar />
      <Switch>
        <Route path='/' exact component={Home}/>
      </Switch>
    </Router>
    </>
  );
}

export default App;
